ured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"The official music video for David Bowie - Life On Mars?\n\nTaken from Bowie's 4th studio album 'Hunky Dory' released in 1971, which featured the singles 'Changes/Andy Warhol' \u0026 'Life On Mars'.\n\nSubscribe to the David Bowie channel for all the best official music videos, live performances and interviews here - \nSubscribe now: http://bit.ly/2lO9yQo\n\nListen to more from the album 'Hunky Dory' here: Album-HunkyDory\n\nWatch David Bowie's official music videos here: https://lnk.to/DavidBowieOfficialVideos\n\nFollow David Bowie:\nhttps://www.davidbowie.com/\nhttps://www.facebook.com/davidbowie/\nhttps://twitter.com/DavidBowieReal\nhttps://www.instagram.com/davidbowie/\n\nLyrics:\nIt's a God-awful small affair\nTo the girl with the mousy hair\nBut her mummy is yelling no\nAnd her daddy has told her to go\nBut her friend is nowhere to be seen\nNow she walks through her sunken dream\nTo the seat with the clearest view\nAnd she's hooked to the silver screen\nBut the film is a saddening bore\nFor she's lived it ten times or more\nShe could spit in the eyes of fools\nAs they ask her to focus on\nSailors fighting in the dance hall\nOh man, look at those cavemen go\nIt's the freakiest show\nTake a look at the lawman\nBeating up the wrong guy\nOh man, wonder if he'll ever know\nHe's in the best selling show\nIs there life on Mars?\nIt's on America's tortured brow\nThat Mickey Mouse has grown up a cow\nNow the workers have struck for fame\n'Cause Lennon's on sale again\nSee the mice in their million hordes\nFrom Ibiza to the Norfolk Broads\nRule Britannia is out of bounds\nTo my mother, my dog, and clowns\nBut the film is a saddening bore\n'Cause I wrote it ten times or more\nIt's about to be writ again\nAs I ask you to focus on\nSailors fighting in the dance hall\nOh man, look at those cavemen go\nIt's the freakiest show\nTake a look at the lawman\nBeating up the wrong guy\nOh man, wonder if he'll ever know\nHe's in the best selling show\nIs there life on Mars?\n\nAbout David Bowie:\nDavid Bowie redefined musical genres and the potential of live performance for generations of music lovers. Creating and discarding a variety of personae and restlessly challenging musical boundaries, Bowie released timeless albums including Space Oddity, Hunky Dory, The Rise and Fall of Ziggy Stardust, Aladdin Sane, Diamond Dogs, Young Americans, Station to Station, \"Heroes, Let's Dance, Heathen, The Next Day and many more. Blackstar, Bowies 28th and final studio album, was released on his 69th birthday, January 8, 2016. David Bowie died on January 10, 2016, two days after the release of Blackstar. His body of work, his influence on the worlds of music, art, fashion, film, theatre and beyond, and his legacy of innovation and reinvention will live forever. 2022 kicks off with Bowie at 75, a celebration of his 75th birthday with the Brilliant Adventure box set, the previously unreleased Toy, the 50th anniversary of Ziggy Stardust and a series of special events.\n\n#DavidBowie #LifeOnMars #HunkyDory #Bowie","commandRuns":[{"startIndex":326,"length":21,"onTap":{"innertubeCommand":{"clickTrackingParams":"CL0CEM2rARgBIhMI8PaLlIS7gAMV2Jr0Bx1YUQAkSOrltf34kqfJAQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbU41VXNsVlp2S0djVjh3cFdSa21uUzYxUEVaUXxBQ3Jtc0trMGRBWDBMbGtnd2F2b1ZrQTdtWGt4aHhPVllZZ3dqRjlFUEJTSkdYNnl4TTRtZHRXc2pKSnM3TG1OOExuVzc1RWRJU3JZdkxfUldxeVZOQWI5dnZGcUU3NVpUV3pOSy0yNU14WkxON0ZpdFpZdE5QSQ\u0026q=http%3A%2F%2Fbit.ly%2F2lO9yQo\u0026v=AZKcl4-tcuo","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbU41VXNsVlp2S0djVjh3cFdSa21uUzYxUEVaUXxBQ3Jtc0trMGRBWDBMbGtnd2F2b1ZrQTdtWGt4aHhPVllZZ3dqRjlFUEJTSkdYNnl4TTRtZHRXc2pKSnM3TG1OOExuVzc1RWRJU3JZdkxfUldxeVZOQWI5d "showMoreText":{"simpleText":"Visa mer"},"showLessText":{"simpleText":"Visa mindre"},"attributedDescriptionBodyText":{"content":"The official music video for David Bowie - Life On Mars?\n\nTaken from Bowie's 4th studio album 'Hunky Dory' released in 1971, which featured the singles 'Changes/Andy Warhol' \u0026 'Life On Mars'.\n\nSubscribe to the David Bowie channel for all the best official music videos, live performances and interviews here - \nSubscribe now: http://bit.ly/2lO9yQo\n\nListen to more from the album 'Hunky Dory' here: Album-HunkyDory\n\nWatch David Bowie's official music videos here: https://lnk.to/DavidBowieOfficialVideos\n\nFollow David Bowie:\nhttps://www.davidbowie.com/\nhttps://www.facebook.com/davidbowie/\nhttps://twitter.com/DavidBowieReal\nhttps://www.instagram.com/davidbowie/\n\nLyrics:\nIt's a God-awful small affair\nTo the girl with the mousy hair\nBut her mummy is yelling no\nAnd her daddy has told her to go\nBut her friend is nowhere to be seen\nNow she walks through her sunken dream\nTo the seat with the clearest view\nAnd she's hooked to the silver screen\nBut the film is a saddening bore\nFor she's lived it ten times or more\nShe could spit in the eyes of fools\nAs they ask her to focus on\nSailors fighting in the dance hall\nOh man, look at those cavemen go\nIt's the freakiest show\nTake a look at the lawman\nBeating up the wrong guy\nOh man, wonder if he'll ever know\nHe's in the best selling show\nIs there life on Mars?\nIt's on America's tortured brow\nThat Mickey Mouse has grown up a cow\nNow the workers have struck for fame\n'Cause Lennon's on sale again\nSee the mice in their million hordes\nFrom Ibiza to the Norfolk Broads\nRule Britannia is out of bounds\nTo my mother, my dog, and clowns\nBut the film is a saddening bore\n'Cause I wrote it ten times or more\nIt's about to be writ again\nAs I ask you to focus on\nSailors fighting in the dance hall\nOh man, look at those cavemen go\nIt's the freakiest show\nTake a look at the lawman\nBeating up the wrong guy\nOh man, wonder if he'll ever know\nHe's in the best selling show\nIs there life on Mars?\n\nAbout David Bowie:\nDavid Bowie redefined musical genres and the potential of live performance for generations of music lovers. Creating and discarding a variety of personae and restlessly challenging musical boundaries, Bowie released timeless albums including Space Oddity, Hunky Dory, The Rise and Fall of Ziggy Stardust, Aladdin Sane, Diamond Dogs, Young Americans, Station to Station, \"Heroes, Let's Dance, Heathen, The Next Day and many more. Blackstar, Bowies 28th and final studio album, was released on his 69th birthday, January 8, 2016. David Bowie died on January 10, 2016, two days after the release of Blackstar. His body of work, his influence on the worlds of music, art, fashion, film, theatre and beyond, and his legacy of innovation and reinvention will live forever. 2022 kicks off with Bowie at 75, a celebration of his 75th birthday with the Brilliant Adventure box set, the previously unreleased Toy, the 50th anniversary of Ziggy Stardust and a series of special events.\n\n#DavidBowie #LifeOnMars #HunkyDory #Bowie","commandRuns":[{"startIndex":326,"length":21,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBwQ040EGAUiEwjw9ouUhLuAAxXYmvQHHVhRACRI6uW1_fiSp8kB","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVZTTzRsLTlXY1pCVUduX3lVaElfOTZoRi1IQXxBQ3Jtc0ttQ1Y0NHlaeEdleXBUNzlPVWtLY3JGdHdlVHdLUXZfaWgxV3Juekxfbi14UWsyYTFDWlVuMmRVYW9NN0Y5UnFJWjktS19qWXFsY3dtTWJnQkVkaG52SGhPWWJjcXVTTFFTTXlTWE5WV2F5OXptdXNaWQ\u0026q=http%3A%2F%2Fbit.ly%2F2lO9yQo\u0026v=AZKcl4-tcuo","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbVZTTzRsLTlXY1pCVUduX3lVaElfOTZoRi1IQXxBQ3Jtc0ttQ1Y0NHlaeEdleXBUNzlPVWtLY3JGdHdlVHdLUXZfaWgxV3Juekxfbi14UWsyYTFDWlVuMmRVYW9NN0Y5UnFJWjktS1
